            string image = "/ 9j /  / +AAEEpGSUYAAQEAAAEAAQAA / 9sAQwACAQEBAQECAQEBAgICAgIEAwICAgIFBAQDBAYFBgYGBQYGBgcJCAYHCQcGBggLCAkKCgoKCgYICwwLCgwJCgoK / 9sAQwECAgICAgIFAwMFCgcGBwoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoK / 8AAEQgFAAPAAwEiAAIRAQMRAf / ";
            byte[] imageBytes = Convert.FromBase64String(image);
            ImageSource a= ImageSource.FromStream(() => new MemoryStream(imageBytes));
            Items.Add(new PostListElement() {
                Id = 9999,
                Subject = "PlaceHolder 1",
                Body = "PlaceHolder Text",
                Created = "2020-09-14T12:59:21.7395836",
                LastUpdated = "2020-09-14T12:59:21.7395836",
                Position = new Coordinate(55.907875776284456, 14.067913798214885),
