                Position = new Coordinate(55.907875776284456, 14.067913798214885),
                Dist = ""
            });
        }

        public void addUnlockedPost(Post x, UnlockedPosts attachment)
        {
            Items.Add(new PostListElement()
            {
                Id = x.getId(),
                Subject = x.getSubject(),
                Body = x.getBody(),
                Created = x.getCreated(),
                LastUpdated = x.getLastUpdated(),
                Position = x.getCoordinate(),
                Dist = "", // Är dist intressant för en upplåst post?
                Img = ImageSource.FromStream(() => new MemoryStream(attachment.imgBytes))
        });
        }

        public void testAddUnlockedPost(int obsId, UnlockedPosts attachment)
        {
            Console.WriteLine("Test entering viewModel and viewModel list size is: " + Items.Count);
            Items.Add(new PostListElement()
            {
                Id = 384,
                Subject = "Test",
                Body = "Test",
                Created = "2020-09-14T12:59:21.7395836",
                LastUpdated = "2020-09-14T12:59:21.7395836",
                Position = new Coordinate(55.907875776284456, 14.067913798214885),
                Dist = "", // Är dist intressant för en upplåst post?
                Img = ImageSource.FromStream(() => new MemoryStream(attachment.imgBytes))
            });
            Console.WriteLine("Test exiting viewModel and viewModel list size is: " + Items.Count);
        }

        public void updateListElements()
        {
            List<Post> posts = user.getUnlocked();
            foreach (Post x in posts)
            {
                if (x.getCoordinate() != null)
                {
                    Items.Add(new PostListElement()
                    {
                        Id = x.getId(),
                        Subject = x.getSubject(),
                        Body = x.getBody(),
                        Created = x.getCreated(),
                        LastUpdated = x.getLastUpdated(),
                        Position = x.getCoordinate(),
                        Dist = ""
                    });
                }
            }
        }

    }


}
